    false,nt"url": null,nt"notes": "EM300 and EM3002D multibeam Data were collected
    from May 25-June 9, 2007, aboard NOAA Ship Hi'ialakai at Saipan Island, Tinian Island,
    Sarigan Island, Zealandia Bank, Anatahan Island, Guguan Island, Alamagan Island,
    Agrihan Island, Asuncion Island, Maug Islands, Supply Reef, Uracus Island, and Pagan
    Island during cruise HI0703. These multibeam data were collected using SAIC ISS-2000
    software in the Generic Sensor Format and processed using SABER editing software.
    Surface sound velocity values were supplied by a Seabird SBE-45 MicroTSG and a SBE-38
    remote temperature probe. Sound velocity corrections from a Seabird 911 CTD sensor
    and motion corrections from a POS-MV vertical reference were applied to the data
    in real time. Predicted tides were applied to the data in real time. Horizontal
    accuracy is 20 m (no differential GPS correctors applied), vertical accuracy is
    depth dependent (~1% of water depth), WGS84 datum. These data are not to be used
    for navigation. Depths mapped range from ~20-3000 m. Concurrent mapping at Saipan
    Island, Tinian Island, Sarigan Island, Zealandia Bank, Anatahan Island, Guguan Island,
    Alamagan Island, Agrihan Island, Asuncion Island, Maug Islands, Supply Reef, Uracus
    Island, and Pagan Island was done by the R/V AHI in water depths ranging from ~10-350
    m with The data set being AHI0703; (metadata for AHI0703 are submitted separately.)",nt"owner_org":
